//@refresh reset
import React, { createContext, useState,View } from 'react'

import { NavigationContainer, } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack'



const Stack = createStackNavigator()

export const emailContext = createContext();


const LoginScreen = () => {
  return (
    <NavigationContainer>

          <Stack.Navigator
            initialRouteName="LoginScreen"
            screenOptions={{
              headerShown: false,
            }}
          >
            <Stack.Screen
              name="LoginScreen"
              component={LoginScreen} />

          </Stack.Navigator>

    </NavigationContainer>
  )
}

const App = () => {
  return (
    <NavigationContainer>

          <Stack.Navigator
            initialRouteName="LoginScreen"
            screenOptions={{
              headerShown: false,
            }}
          >
            <Stack.Screen
              name="LoginScreen"
              component={LoginScreen} />

          </Stack.Navigator>

    </NavigationContainer>
  )
}

export default App;
